define({"topics" : [{"title":"Overview","shortdesc":"\n               <p class=\"shortdesc\">This topic contains information about various tabs and panels, and on viewing test   results.</p>\n            ","id":"concept_s3n_clc_qz","href":"TA_Help\/Topics\/ug_test_results_introduction.html","menu": {"hasChildren":false,},"tocID":"concept_s3n_clc_qz-d46e27089","next":"concept_s3n_clc_qz-d46e27089",},{"title":"Converting test results","shortdesc":"\n               <p class=\"shortdesc\">It is required to convert test results created in versions prior to <span class=\"ph\">TestArchitect</span> 8.3 into the new XML format. This topic explains how     to convert test results and several important notes for test result\n                  conversion.\n               </p>\n            ","id":"concept_xcf_s1v_ky","href":"TA_Help\/Topics\/ug_XML_result_conversion.html","menu": {"hasChildren":false,},"tocID":"concept_xcf_s1v_ky-d46e27201","next":"concept_xcf_s1v_ky-d46e27201",},{"title":"Customizing XML test results","shortdesc":"\n               <p class=\"shortdesc\">In order to customize the layout of XML test results, you are required to edit XSLT     style sheets.</p>\n            ","id":"concept_rhs_51n_ky","href":"TA_Help\/Topics\/ug_customizing_XML_report.html","menu": {"hasChildren":false,},"tocID":"concept_rhs_51n_ky-d46e27257","next":"concept_rhs_51n_ky-d46e27257",},{"title":"Viewing latest test results","shortdesc":"\n               <p class=\"shortdesc\">Viewing the local result details of the most recently executed test.</p>\n            ","id":"Test_result_viewing_latest_result","href":"TA_Help\/Topics\/Test_result_viewing_latest_result.html","menu": {"hasChildren":false,},"tocID":"Test_result_viewing_latest_result-d46e27304","topics":[]},{"title":"Adding test results to the repository","shortdesc":"\n               <p class=\"shortdesc\">Test results reside locally, in the <span class=\"ph uicontrol\">LOCAL RESULTS</span> node, until   they are either deleted or explicitly added to the repository.\n               </p>\n            ","id":"Test_result_storing","href":"TA_Help\/Topics\/Test_result_storing.html","menu": {"hasChildren":false,},"tocID":"Test_result_storing-d46e27315","next":"Test_result_storing-d46e27315",},{"title":"Exporting test results","shortdesc":"\n               <p class=\"shortdesc\">Test run results stored on the local machine or in the repository can be converted and     exported to <span class=\"ph filepath\">.TARESULT</span>, <span class=\"ph filepath\">HTML</span>, <span class=\"ph filepath\">XML</span>,     and <span class=\"ph filepath\">xUnit</span>.\n               </p>\n            ","id":"Test_result_export_results","href":"TA_Help\/Topics\/Test_result_export.html","menu": {"hasChildren":false,},"tocID":"Test_result_export_results-d46e27354","next":"Test_result_export_results-d46e27354",},{"title":"Importing test results from ZIP file","shortdesc":"\n               <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> lets you easily import a repository test     result archive file (<span class=\"ph filepath\">.ZIP</span> format). \n               </p>\n            ","id":"Test_result_export_import_from_ZIPs","href":"TA_Help\/Topics\/Test_result_import.html","menu": {"hasChildren":false,},"tocID":"Test_result_export_import_from_ZIPs-d46e27474","topics":[]},{"title":"Importing test results from <span class=\"ph filepath\">.TARESULT</span> files\n            ","shortdesc":"\n               <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> lets you easily import a test result         archive file (<span class=\"ph filepath\">.TARESULT</span> format). \n               </p>\n            ","id":"concept_ntk_5np_p1b","href":"TA_Help\/Topics\/ug_importing_test_results.html","menu": {"hasChildren":false,},"tocID":"concept_ntk_5np_p1b-d46e27490","next":"concept_ntk_5np_p1b-d46e27490",},{"title":"Comparing test results","shortdesc":"\n               <p class=\"shortdesc\">Comparing the results of two test runs is useful in tracking and debuggingÂ new and   existing issues in the AUT.</p>\n            ","id":"Test_result_baselining","href":"TA_Help\/Topics\/Test_result_baselining.html","menu": {"hasChildren":false,},"tocID":"Test_result_baselining-d46e27543","next":"Test_result_baselining-d46e27543",},{"title":"Opening latest test result","shortdesc":"\n               <p class=\"shortdesc\">Opening the most recent result, for a test run multiple times.</p>\n            ","id":"Test_result_opening_latest_test_result","href":"TA_Help\/Topics\/Test_result_open_latest_test_result.html","menu": {"hasChildren":false,},"tocID":"Test_result_opening_latest_test_result-d46e27616","topics":[]},{"title":"Opening baseline result","shortdesc":"\n               <p class=\"shortdesc\">If your test module contains a baseline test result, you can conveniently open that     result.</p>\n            ","id":"Test_result_open_baseline_result","href":"TA_Help\/Topics\/Test_result_open_baseline_result.html","menu": {"hasChildren":false,},"tocID":"Test_result_open_baseline_result-d46e27628","topics":[]},{"title":"Receiving test results of remote test execution","shortdesc":"\n               <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> allows you to execute a test remotely and     receive the test results from the remote machine, although <span class=\"ph\">TestArchitect Client</span> is closed on the local machine, even before the remote     execution is complete.\n               </p>\n            ","id":"Test_result_remote","href":"TA_Help\/Topics\/Test_result_remote.html","menu": {"hasChildren":false,},"tocID":"Test_result_remote-d46e27639","topics":[]},{"title":"Displaying test results in a browser","shortdesc":"\n               <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> test results         may be opened in a web browser on any machine. <span class=\"ph\">TestArchitect</span> need not be installed to view the         results.\n               </p>\n            ","id":"task_d44_2nh_35","href":"TA_Help\/Topics\/ug_test_results_open_in_browser.html","menu": {"hasChildren":false,},"tocID":"task_d44_2nh_35-d46e27655","topics":[]}]});